import React from 'react';
import './App.css';
import logo from './logo.jpg';

function Navbar() {
  return (
    <div className="navbar-wrapper" height="20px" >
        <img src={logo} className="" alt="Explore Edinburgh Logo" />
    </div>
  );
}

export default Navbar;
